export let colors = [
  {
    "name": "Absolute Zero",
    "hex": "#0048BA"
  },
  {
    "name": "Acid Green",
    "hex": "#B0BF1A"
  },
  {
    "name": "Aero",
    "hex": "#7CB9E8"
  },
  {
    "name": "Aero Blue",
    "hex": "#C9FFE5"
  },
  {
    "name": "African Violet",
    "hex": "#B284BE"
  },
  {
    "name": "Air Force Blue (RAF)",
    "hex": "#5D8AA8"
  },
  {
    "name": "Air Force Blue (USAF)",
    "hex": "#00308F"
  },
  {
    "name": "Air Superiority Blue",
    "hex": "#72A0C1"
  },
]

export function getColor (){
  const randomIndex = Math.floor(Math.random() * colors.length)
  const arr = [];
  arr.push(colors[randomIndex].hex, colors[randomIndex].name)
  return [arr]
}
